import React from "react";
import Image from "../../assets/Image.png";
import { Box, Typography, Button } from "@mui/material";
import { makeStyles } from "@mui/styles";
// import rightHalf from "../../assets/images/right-2.png";


const useStyle = makeStyles({


  article: {
    height: '100%',
    position: 'relative',
    overflow: 'hidden',
},

picture: {
    objectFit: 'cover',
    width: '100%',
    height: '100%',
   
},


});

const BlogPanel = () => {
  const classess = useStyle();
  
  return (
    <>
       <Box className={classess.article}>
      <Box component='img' className={classess.image} sx={{zIndex:50}} src={Image} alt="background" />
     
      <Box sx={{}}>
      <Typography sx={{ fontSize: '80px',
    color: 'white',
    alignItems:'center',
    textAlign: 'center',
    position: 'absolute',
    top: 0,
    bottom: 0,
    left: 0,
    right: 0,
    
    margin: 'auto',
   
    background: '#1E1B1B',
    
    height:'100vh fit-content',
opacity: 0.8
    
    }}>React Is Awesome</Typography>
    </Box>
    </Box>
    </>
  );
};

export default BlogPanel;
